import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomeContainer from '../Containers/HomeContainer';

function Navigation() {
    return (
        <Router>
            <Routes>
                <Route path='/' exact component={HomeContainer} />
            </Routes>
        </Router>
    )
}
export default Navigation
